import { useState } from "react";
import axios from "axios";
import "./Enroll.css";

const Enroll = () => {
  const [formData, setFormData] = useState({
    phone: "",
    plan: "",
    startDate: "",
    duration: "",
    emergencyContact: "",
    medicalCondition: "",
    paymentMode: "",
    amountPaid: "",
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const token = localStorage.getItem("token");

      await axios.post("http://localhost:3001/api/enroll", formData, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });

      alert("Enrollment successful!");
      
    } catch (err) {
      alert(err.response?.data?.message || "Enrollment failed");
    }
  };

  return (
    <div className="enroll-body">
      <div className="enroll-container">
        <h2>Gym Enrollment Form</h2>

        <form onSubmit={handleSubmit}>
          <input
            type="text"
            name="phone"
            placeholder="Mobile Number"
            required
            onChange={handleChange}
          />

          <select name="plan" required onChange={handleChange}>
            <option value="">Select Plan</option>
            <option value="1 Month">1 Month</option>
            <option value="3 Months">3 Months</option>
            <option value="6 Months">6 Months</option>
            <option value="12 Months">12 Months</option>
          </select>

          <input
            type="date"
            name="startDate"
            required
            onChange={handleChange}
          />

          <select name="duration" required onChange={handleChange}>
            <option value="">Duration</option>
            <option value="1">1 Month</option>
            <option value="3">3 Months</option>
            <option value="6">6 Months</option>
            <option value="12">12 Months</option>
          </select>

          <input
            type="text"
            name="emergencyContact"
            placeholder="Emergency Contact Number"
            required
            onChange={handleChange}
          />

          <textarea
            name="medicalCondition"
            placeholder="Medical Conditions (Optional)"
            onChange={handleChange}
          />

          <select name="paymentMode" required onChange={handleChange}>
            <option value="">Payment Mode</option>
            <option value="UPI">UPI</option>
            <option value="Cash">Cash</option>
            <option value="Card">Card</option>
          </select>

          <input
            type="number"
            name="amountPaid"
            placeholder="Amount Paid"
            required
            onChange={handleChange}
          />

          <button type="submit">Enroll Now</button>
        </form>
      </div>
    </div>
  );
};

export default Enroll;
